import React from 'react'
import Tour from './Tour'

const Tours = ({ tour }) => {
  return (
    <section>
      <div className='title'>
        <h2>Our Tours</h2>
        <div className='underline'></div>
        <div>
        {tour.map((tour) => {
          return <Tour />
        })}
        </div>
      </div>
    </section>
  )
}

export default Tours
